import Vue from 'vue'
import VueRouter from 'vue-router'
Vue.use(VueRouter);
// 引人组件
import Home from '@/views/Home';
import Test from '@/views/Test'

const router = new VueRouter({
    routes:[
        
        {
            path:'/test',
            component:Test
        },
        {
            path:'/',
            redirect:Test
        }
    ]
})

export default router
